import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Substitua Switch por Routes
import ProductList from '../../ProductList';
import Cart from '../../Cart';

const products = [
  { id: 1, name: 'Book 1' },
  { id: 2, name: 'Book 2' }
];

const App = () => {
  return (
    <Router>
      <Routes> {/* Substitua Switch por Routes */}
        <Route path="/" element={<ProductList products={products} />} /> {/* Use element no lugar de children */}
        <Route path="/cart" element={<Cart />} />
      </Routes>
    </Router>
  );
};

export default App;
